import React from 'react';

const renderNestedJson = (json) => {
    return JSON.stringify(json, null, 2);
    };



const CountryCard = ({ country }) => {
    if (!country) return null;
    const { name, capital, population, currencies, languages, flag } = country[0];
    return (
        <div className="card mt-4">
        <img src={flag} className="card-img-top" alt="..." />
        <div className="card-body">
            <h5 className="card-title">{name.common}</h5>
            <p className="card-text">
            <strong>Capital:</strong> {capital}
            </p>
            <p className="card-text">
            <strong>Population:</strong> {population}
            </p>
            <p className="card-text">
            <strong>Currencies:</strong> {renderNestedJson(currencies)}
            </p>
            <p className="card-text">
            <strong>Languages:</strong> {renderNestedJson(languages)}
            </p>
        </div>
        </div>
    );
    }

    export default CountryCard;
